import { Fonction } from "./fonction.model";
import { Role } from "./role.model";

export class Permission {
  id: number;
  nom: string | null;
  status: string;
  idRole: number;
  role: Role | null;
  idFonction: number;
  fonction: Fonction | null;

  constructor() {
    this.id = 0;
    this.nom = null;
    this.status = "111111";
    this.idRole = 0;
    this.role = null;
    this.idFonction = 0;
    this.fonction = null;
  }
}
